import "../index.css";

const Start = () => {
  <>
    <section className="start-logo">
      <img src="../images/main-logo.svg" alt=""></img>
      <button className="start-button">GET STARTED</button>
      <p className="start-text">LOGIN</p>
    </section>
  </>;
};

export default Start;
